import React from 'react'
import Cartoon from '../components/Cartoon/Cartoon'
import { Grid, Typography } from '@material-ui/core'

const useStyles = makeStyles((theme) => ({
  root: {},

  heading: {
    fontSize: '4.5em',
    letterSpacing: '-1px',
    backgroundColor: '#503e9d',
    color: 'white',
  },
}))

function Home() {
  return (
    <div>
      <Grid container justify='center'>
        <Grid xs={12}>
          <Cartoon />
        </Grid>
      </Grid>
    </div>
  )
}

export default Home
